    [],nt"revision_timestamp": "2016-07-27T23:03:51.929867",nt"name": "mississippi-department-of-environmental-quality-general-report-on-well-groundwater-for-hil",nt"isopen":
    false,nt"url": null,nt"notes": "Two of the rice irrigation wells were sampled
    in August, 1998, as part of the Agrichemical Groundwater Monitoring Program. This
    program is not regulatory in any way, but is simply to provide information on groundwater
    quality in the State of Mississippi. The samples from the wells were analyzed for
    approximately 100 pesticides, along with chlorides and nitrates. The purpose of
    this letter is to advise of the results of these analyses which have just been received
    from the Mississippi State Chemical Laboratory. The Mississippi Office of Pollution
    Control determines the quality of groundwater using federal guidelines which are
    divided into Primary and Secondary Regulations. Primary Regulations are based on
    health considerations and are the most important. Secondary Regulations relate to
    other qualities such as color, taste, odor, staining, etc. and are lesser in importance.
    Maximum contaminant Levels (MCL's) have been established for many items considered
    to be the most important in both primary and secondary Regulations. However, it
    should be noted that MCL's have not been established on all compounds included in
    this report. The analyses of samples from your wells did not detect any pesticides
    or contaminants which exceeded present Primary or Secondary Drinking Water MCL's.
    The results from our AgChem tests indicate the overall quality of your water to
    be very good at this time with regards to agricultural chemicals, chlorides and
    nitrates.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
